import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './login.module.css';
import Modal from './modals/Modal';

function LoginPage() {
    let navigate = useNavigate();
    // 이벤트 핸들러는 useNavigate 훅으로부터 받은 navigate 함수를 사용
    const submitHandler = (event) => {
        event.preventDefault();
        navigate('/loading');
    };

    const [isModalOpen, setIsModalOpen] = useState(false);

    const openModal = () => {
        setIsModalOpen(true)
    };
    const closeModal = () => { setIsModalOpen(false) };

    return (
        <div>
            <div className={styles.ring}>
                <i style={{ '--clr': '#00ff0a' }}></i>
                <i style={{ '--clr': '#ff0057' }}></i>
                <i style={{ '--clr': '#fffd44' }}></i>
                <div className={styles.login}>
                    <h2>N E T R U N N E R</h2>
                    <form onSubmit={submitHandler}>
                        <div className={styles.inputBx}>
                            <input type="text" name="username" placeholder="아이디" required />
                        </div>
                        <div className={styles.inputBx}>
                            <input type="password" name="password" placeholder="비밀번호" required />
                        </div>
                        <div className={styles.inputBx}>
                            <input type="submit" value="로그인" />
                        </div>
                    </form>
                    <div className={styles.links}>
                        <a href="#" onClick={(e) => { e.preventDefault(); openModal(); }} >비밀번호 찾기</a>
                        <Modal isOpen={isModalOpen} closeModal={closeModal}>
                            <div>
                                <div className={styles.modal} id="passwordResetModal">
                                    <div className={styles.modal_content}>
                                        <span className={styles.close}>&times;</span>
                                        <h2>비밀번호 찾기</h2>
                                        <form id="passwordResetForm" onSubmit="return validatePasswordResetForm(event)">
                                            <div className={styles.inputBx}>
                                                <input type="email" name="email" placeholder="이메일" required />
                                                <input type="button" value="인증" id="verifyEmailButton" onClick="requestEmailVerification()" />
                                            </div>
                                            <div className={styles.inputBx} id="verificationCodeBox" >
                                                <input type="text" name="verificationCode" placeholder="인증번호" required />
                                                <input type="button" value="인증번호 확인" id="checkVerificationCodeButton" />
                                            </div>
                                            <div className={styles.inputBx} id="newPasswordBox">
                                                <input type="password" name="newPassword" placeholder="새 비밀번호" required />
                                                <input type="password" name="confirmNewPassword" placeholder="새 비밀번호 확인" required />
                                                <input type="submit" value="비밀번호 재설정" id="resetPasswordButton" />
                                            </div>
                                        </form>
                                    </div>
                                </div>
                            </div>
                        </Modal>
                        <a href="#" onClick={(e) => { e.preventDefault(); openModal(); }}>회원가입</a>
                    </div>
                </div>
            </div >
        </div >
    );
}
export default LoginPage;
